import React from 'react';
import '../App.css';

class Index extends React.Component {

  render() {
    return (
      <div className="App-header">
        <h1>Hello World from Index</h1>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
      </div>
    );
  }
}

export default Index;
